🚨 #CyberAttack 🚨

🇯🇵 #Japan: KADOKAWA Corporation, a Japanese media conglomerate, has been listed as a victim by the Black Suit ransomware group. 

The hackers allegedly exfiltrated 1.5 TB of data, including:

- Contracts; 
- DocuSigned papers; 
- Various legal papers; 
- Platform users' data (emails, data usage, links opened);
- Employee data (personal info, payments, contracts, emails);
- Business planning (presentations, emails, offers);
- Projects data (coding, emails, payments);
- Financial data (payments, transfers, planning);
- Other internal-use-only papers and confidential data.

Ransom deadline: 01st Jul 24.

Meanwhile, KADOKAWA Corporation announced:

"Due to a system failure that occurred before dawn on Saturday, June 8, 2024, multiple websites of the KADOKAWA Group, including the KADOKAWA Group global portal site, are inaccessible."
https://tp.kadokawa.co.jp/

#Ransomware

